@prefix : <http://www.example.com/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:Withdrawal a owl:Class .

:hasAssociatedAccount a owl:ObjectProperty ;
    rdfs:domain :Withdrawal ;
    rdfs:range :Account .

:hasAmount a owl:DatatypeProperty ;
    rdfs:domain :Withdrawal ;
    rdfs:range xsd:decimal .

:Account a owl:Class .

:Withdrawal rdfs:subClassOf [ 
    a owl:Restriction ;
    owl:onProperty :hasAssociatedAccount ;
    owl:minCardinality 1
] , [
    a owl:Restriction ;
    owl:onProperty :hasAmount ;
    owl:minCardinality 1
] .
